import React from 'react';
import '../Styles/Testimonial.css';
import Slider from 'react-slick';


const Testimonial = () => {
  return (
    <section>
        <Slider>
            <div className="slide_item">
                <p className="description">
                    
                </p>
            </div>
        </Slider>
    </section>
  );
};

export default Testimonial;
